import * as ActionTypes from "../Types";
import { getData, getDataWithToken, postData } from "../services";

const oncreateDietician = (payload) => {
  console.log(payload);
  if(payload.code) {
    console.log(payload.code);
    return {
      type: ActionTypes.CREATE_DIETICIAN_FAIL,
      payload
    }
  } else if(payload.code) {
    return {
      type: ActionTypes.CREATE_DIETICIAN_SUCCESS,
      payload
    }
  }
};

export const createDietician = (url, payload) => {
  return postData(url, payload, oncreateDietician);
}

export const createDieticianStateToDefault = () => {
  return {
    type: ActionTypes.CREATE_DIETICIAN_DEFAULT,
  }
}

const onGetAllDieticians = (payload) => {
  return {
    type: ActionTypes.GET_ALL_DIETICIANS,
    payload
  }
}

export const getAllDietitians = (url) => {
  return getDataWithToken(url, onGetAllDieticians);
}
